import React, { Component } from 'react'
import addArticleIcon from '../create-article.svg'
import selectIcon from '../search-sign.svg'

class Menu extends Component{

	state={
		links: [ addArticleIcon, selectIcon ]
	} 

	render(){
		const inMenu  = this.state.links.map((link, index)=>			
			<li key={index}>
				link={link}
			</li>
		)				  

		return(
			<ul>
				{inMenu}
			</ul>
		)	
}
}
export default Menu
